--修改内容：清理报表S63，S4,S65
--1104报表还未上线，该三张报表已经拆分成多张，原报表不再需要

--清理报表数据
DELETE FROM RPT1104_REPORT_DATA
 WHERE MIAN_ID IN
       (SELECT MAIN_ID --查询报表主档ID
          FROM RPT1104_REPORT_MAIN
         WHERE RPT_ID IN
               (SELECT RPT_ID --查询报表ID
                  FROM RPT1104_REPORT_INFO
                 WHERE RPT_CODE IN ('S63', 'S64', 'S65')));
GO
--清理报表单元格信息
DELETE FROM RPT1104_REPORT_CSS
 WHERE RPT_ID IN (SELECT RPT_ID --查询报表ID
                    FROM RPT1104_REPORT_INFO
                   WHERE RPT_CODE IN ('S63', 'S64', 'S65'));
GO
--清理主档
DELETE FROM RPT1104_REPORT_MAIN
 WHERE RPT_ID IN (SELECT RPT_ID --查询报表ID
                    FROM RPT1104_REPORT_INFO
                   WHERE RPT_CODE IN ('S63', 'S64', 'S65'));
GO
--清理报表信息
DELETE FROM RPT1104_REPORT_INFO WHERE RPT_CODE IN ('S63', 'S64', 'S65');
GO

--删除S3d报表的单元格信息，重新定义
DELETE RPT1104_REPORT_CSS
 WHERE RPT_ID=(SELECT RPT_ID
          FROM RPT1104_REPORT_INFO INFO
         WHERE INFO.RPT_CODE = 'S3d');
GO

